const getDataFromApi = () => {
    console.log('Pidiendo datos...');
    return fetch('https://beta.adalab.es/ejercicios-extra/api/eshop/v2/cart.json')
    .then(response => response.json())
    .then(data => {
        console.log(data);
        return data.cart.items;
    });
}

export default getDataFromApi;
